function Stock(productsArray) {
  return (
    <table>
      <thead>
        <th>Id</th>
        <th>NombreProducto</th>
        <th>Cantidad</th>
        <th>precio</th>
        <th>minStock</th>
      </thead>
      <tbody>
      {
      productsArray.admin.products.forEach(element => {
        <tr>
          <td>{element.id}</td>
          <td>{element.name}</td>
          <td>{element.quantity}</td>
          <td>{element.price}</td>
          <td>{element.minStock}</td>
        </tr>
      })}
    </tbody>
  </table>
)}

export default Stock;
